import styled from 'styled-components';

export const Container = styled.div`
  max-width: 600px;
  margin: 50px auto;

  display: flex;
  flex-direction: column;

  button {
    width: 100%;
    text-align: center;
    border: 2px dashed #dedede;
    background: none;
    color: #7b7b7b;
    font-size: 20px;
    font-weight: normal;
    padding: 10px 20px;
  }

  ul {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-gap: 15px;
    margin-top: 30px;
  }
`;

export const Time = styled.li`
  padding: 20px;
  border-radius: 4px;
  background: #fff;

  opacity: ${props => (props.past ? 0.6 : 1)};

  strong {
    display: block;
    color: $ {
      props => (props.available ? '#999' : '#999')
    };
    font-size: 20px;
    font-weight: normal;
  }

  span {
    display: block;
    margin-top: 3px;
    color: $ {
      props => (props.available ? '#999' : '#999')
    };
  }
`;
